import React from 'react';
import "./Sidebar.css";
import SidebarOption from './SidebarOptions';
import HomeIcon from "@material-ui/icons/Home";
import SearchIcon from "@material-ui/icons/Search";
//import LibraryMusicIcon from "@material-ui/icons/Library";

function Sidebar() {
    return (
        <div className="sidebar">
         <img 
         className="sidebar__logo" 
         src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/2a9bee67-1b86-42ba-893f-8a8c5a3e1733/d8wpo2o-c62ef7c1-9ec5-43d6-b328-659d5f4f7866.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..5HM5mrE2AgSxyTWke0BTrIVO_2LOndPDxmggHatYi_I" 
         alt=""
         />
         <SidebarOption Icon={HomeIcon} title="Home" />
         <SidebarOption Icon={SearchIcon} title="Search" />
         <SidebarOption Icon={LibraryMusicIcon} title="Your Library" />

         <br />
         <strong className="sidebar__title">PLAYLISTS</strong>
         <hr />
        </div>
    )
}

export default Sidebar
